import React, { Component } from "react";
import SliderShow from "../components/SliderShow";
import { GridList, Grid } from "@material-ui/core";
import "./Home.css";

class Home extends Component {
  render() {
    return (
      <div className="home-container">
        <SliderShow />
        <img
          src={require("../images/Header_v2._CB1572630231_.jpg")}
          alt=""
          className="header-image"
        />
        <Grid>
          <img
            src={require("../images/HeroWomens_1._CB449724353_.jpg")}
            alt=""
            style={{ margin: 10 }}
            className="header-image"
          />
        </Grid>
        <img
          src={require("../images/Heromens_1x._CB1573504618_.gif")}
          alt=""
          style={{ margin: 10 }}
          className="heromens-image"
        />
        <div>
          <span className="header-deals">Giày ống giảm giá</span>
          <Grid direction="row" container spacing={10}>
            <Grid item>
              <img
                src={require("../images/Featured1._CB449724364_.jpg")}
                alt=""
                style={{ margin: 10 }}
                className="image-medium-large"
              />
              <div>
                <span>Giày ống của nữ</span>
                <span>100.000 vnd </span>
              </div>
            </Grid>
          </Grid>
        </div>
        <GridList
          cols={3}
          spacing={10}
          cellHeight={350}
          style={{ justifyContent: "center" }}
        >
          {[1, 2, 3].map(t => (
            <img
              src={require("../images/75210475_1457858117712801_1937296649730636142_n.jpg")}
              alt=""
              style={{ margin: 10, maxWidth: 420 }}
            />
          ))}
        </GridList>
        <GridList
          cols={4}
          spacing={10}
          cellHeight={350}
          style={{ justifyContent: "center" }}
        >
          {[1, 2, 3, 4, 5, 6, 7, 8].map(t => (
            <img
              src={require("../images/75210475_1457858117712801_1937296649730636142_n.jpg")}
              alt=""
              style={{ maxWidth: 330, marginTop: 10 }}
            />
          ))}
        </GridList>
      </div>
    );
  }
}

export default Home;
